import React from 'react'

const Calendar = ({ month, days }) => {

  const arrayOfDays = [...Array(days).keys()];

  const resultDays = arrayOfDays.map((el, index) => {
    return <li key={index}>{el}</li>
  })

  return (
    <div className='calendar'>
      <h4>{month}</h4>
      <ul className='weekdays'>
        <li>Mo</li>
        <li>Tu</li>
        <li>We</li>
        <li>Th</li>
        <li>Fr</li>
        <li>Sa</li>
        <li>Su</li>
      </ul>
      <ul className='days'>
        {resultDays}
      </ul>
    </div>
  )
}

export default Calendar
